using namespace std;

template <typename T>
bool IsSameObject(T& value1, T& value2) {
    if (&value1 == &value2)
        return true;
    return false;
    /*–ù–∞–ø–∏—à–∏—Ç–µ —Ç–µ–ª–æ —Ñ—É–Ω–∫—Ü–∏–∏ —Å–∞–º–æ—Å—Ç–æ—è—Ç–µ–ª—å–Ω–æ */
}

int main() {
    using namespace std;

    const int x = 1;
    const int y = 1;

    //x –∏ y ‚Äî —Ä–∞–∑–Ω—ã–µ –æ–±—ä–µ–∫—Ç—ã, —Ö–æ—Ç—å –∏ –∏–º–µ—é—â–∏–µ –æ–¥–∏–Ω–∞–∫–æ–≤–æ–µ –∑–Ω–∞—á–µ–Ω–∏–µ
    assert(!IsSameObject(x, y));
    // –û–±–∞ –∞—Ä–≥—É–º–µ–Ω—Ç–∞ ‚Äî –æ–¥–∏–Ω –∏ —Ç–æ—Ç –∂–µ –æ–±—ä–µ–∫—Ç
    assert(IsSameObject(x, x));

    const string name1 = "Harry"s;
    const string name1_copy = name1;
    const string name2 = "Ronald"s;
    auto name1_ptr = &name1;
    const string& name1_ref = name1;

    assert(!IsSameObject(name1, name2));  // –î–≤–µ —Å—Ç—Ä–æ–∫–∏ —Å —Ä–∞–∑–Ω—ã–º–∏ –∑–Ω–∞—á–µ–Ω–∏—è–º–∏ ‚Äî —Ä–∞–∑–Ω—ã–µ –æ–±—ä–µ–∫—Ç—ã
    assert(!IsSameObject(name1, name1_copy));  // –°—Ç—Ä–æ–∫–∞ –∏ –µ—ë –∫–æ–ø–∏—è ‚Äî —Ä–∞–∑–Ω—ã–µ –æ–±—ä–µ–∫—Ç—ã

    // –û–±–∞ –ø–∞—Ä–∞–º–µ—Ç—Ä–∞ —Å—Å—ã–ª–∞—é—Ç—Å—è –Ω–∞ –æ–¥–Ω—É –∏ —Ç—É –∂–µ —Å—Ç—Ä–æ–∫—É
    assert(IsSameObject(name1, name1));
    assert(IsSameObject(name2, name2));
    assert(IsSameObject(name1_copy, name1_copy));

    // –†–∞–∑—ã–º–µ–Ω–æ–≤–∞–Ω–Ω—ã–π —É–∫–∞–∑–∞—Ç–µ–ª—å –Ω–∞ –æ–±—ä–µ–∫—Ç –∏ —Å–∞–º –æ–±—ä–µ–∫—Ç ‚Äî –æ–¥–∏–Ω –∏ —Ç–æ—Ç –∂–µ –æ–±—ä–µ–∫—Ç
    assert(IsSameObject(*name1_ptr, name1));

    // –ü–µ—Ä–µ–º–µ–Ω–Ω–∞—è –∏ —Å—Å—ã–ª–∫–∞ –Ω–∞ –Ω–µ—ë –æ—Ç–Ω–æ—Å—è—Ç—Å—è –∫ –æ–¥–Ω–æ–º—É –∏ —Ç–æ–º—É –∂–µ –æ–±—ä–µ–∫—Ç—É
    assert(IsSameObject(name1_ref, name1));
    // –°—Å—ã–ª–∫–∞ –Ω–∞ –æ–±—ä–µ–∫—Ç –∏ —Ä–∞–∑—ã–º–µ–Ω–æ–≤–∞–Ω–Ω—ã–π —É–∫–∞–∑–∞—Ç–µ–ª—å –Ω–∞ –æ–±—ä–µ–∫—Ç –æ—Ç–Ω–æ—Å—è—Ç—Å—è –∫ –æ–¥–Ω–æ–º—É –∏ —Ç–æ–º—É –∂–µ –æ–±—ä–µ–∫—Ç—É
    assert(IsSameObject(name1_ref, *name1_ptr));
}

