// –®–∞–±–ª–æ–Ω–Ω–∞—è —Ñ—É–Ω–∫—Ü–∏—è Swap –æ–±–º–µ–Ω–∏–≤–∞–µ—Ç –∑–Ω–∞—á–µ–Ω–∏—è –¥–≤—É—Ö –æ–±—ä–µ–∫—Ç–æ–≤ –æ–¥–Ω–æ–≥–æ –∏ —Ç–æ–≥–æ –∂–µ —Ç–∏–ø–∞,
// —É–∫–∞–∑–∞—Ç–µ–ª–∏ –Ω–∞ –∫–æ—Ç–æ—Ä—ã–µ –æ–Ω–∞ –ø—Ä–∏–Ω–∏–º–∞–µ—Ç –≤ –∫–∞—á–µ—Å—Ç–≤–µ –∞—Ä–≥—É–º–µ–Ω—Ç–æ–≤
template <typename T>
void Swap(T* value1, T* value2) {
    T p = *value1;
    *value1 = *value2;
    *value2 = p;

    // –†–µ–∞–ª–∏–∑—É–π—Ç–µ —Ç–µ–ª–æ —Ñ—É–Ω–∫—Ü–∏–∏ —Å–∞–º–æ—Å—Ç–æ—è—Ç–µ–ª—å–Ω–æ
}

int main() {
    using namespace std;

    {
        int x = 1;
        int y = 5;

        Swap(&x, &y);
        assert(x == 5);
        assert(y == 1);
    }

    {
        string one = "one"s;
        string two = "two"s;
        Swap(&one, &two);
        assert(one == "two"s);
        assert(two == "one"s);
    }

    {
        // –í–∏–¥–∏–º–æ—Å—Ç—å —Å—Ç—Ä—É–∫—Ç—É—Ä—ã Point –æ–≥—Ä–∞–Ω–∏—á–µ–Ω–∞ —Ç–µ–∫—É—â–∏–º –±–ª–æ–∫–æ–º
        struct Point {
            int x, y;
        };

        Point p1{ 1, 2 };
        Point p2{ 3, 4 };

        Swap(&p1, &p2);
        assert(p1.x == 3 && p1.y == 4);
        assert(p2.x == 1 && p2.y == 2);
    }
    return 0;
}

